const db = require('db');

function load_to_RAM(game_uuid, cb) {

  cb = cb || function() {};

  db.games.findOne({
    uuid: game_uuid
  }).lean().exec(function(err, game) {

    if (err) {
      return cb({
        status: 500,
        err: err
      });
    }

    
  })
}

module.exports = load_to_RAM;
